import React from 'react';

const nav = () => {

    return (
    <nav>
        <h3>TechEd Logo</h3>
        <ul>
            <li>About</li>
            <li>Pricing</li>
            <li>Our Difference</li>
            <li>Contact</li>
            <li>Login</li>
            <li>Sign Up</li>
        </ul>
    </nav>
    )
}
export default nav;
